    ro: "Cercetatorul vă solicită să furnizați ID-ul EasyEyes din sesiunea anterioară, vă rugăm să-l introduceți aici sau să încărcați fișierul descărcat când se termină ultima sesiune.",
    ru: "Исследователь просит вас предоставить свой идентификатор EasyEyes из предыдущего сеанса. Введите его здесь или загрузите файл, загруженный после завершения последнего сеанса.",
    sr: "Истраживач захтева да доставите свој ЕасиЕиес ИД из претходне сесије, унесите га овде или отпремите преузету датотеку када се последња сесија заврши.",
