    "en-US":
      'A unique ID is needed to link data across sessions. This computer previously participated in a session on **ddd** with EasyEyes ID “**sss**”. Press OK if that\'s you. Otherwise, if you have an EasyEyes ID file, press the file selection button below to open it. (The filename begins with "EasyEyes", ends with ".txt", and is typically in your Downloads folder.) If you don\'t have a file, but know your EasyEyes ID, then type it. Otherwise, just make up your own ID, which can be any alphanumeric string (plus underscore "_", dash "-", and period ".") at least 5 characters long. It can be your name, if you like. We\'ll remember it for you on this computer, but if you go to another computer, please take your EasyEyes ID file (the most recent file in your Downloads folder), or at least write down your EasyEyes ID. Use it every time to link your data from session to session.',
    ar: '\nيُطلب معرف فريد لربط البيانات عبر الجلسات. شارك هذا الكمبيوتر سابقًا في جلسة في **ddd** بمعرف EasyEyes “**sss**”. اضغط على موافق إذا كان هذا أنت. وإلا، إذا كان لديك ملف معرف EasyEyes، اضغط على زر اختيار الملف أدناه لفتحه. (يبدأ اسم الملف بـ "EasyEyes"، وينتهي بـ ".txt"، وعادة ما يكون في مجلد التنزيلات الخاص بك.) إذا لم يكن لديك ملف، ولكنك تعرف معرف EasyEyes الخاص بك، فاكتبه. وإلا، فقط اختر معرفًا خاصًا بك، والذي يمكن أن يكون أي سلسلة أبجدية رقمية لا تقل عن 5 أحرف. يمكن أن يكون اسمك، إذا أردت. سنتذكره لك على هذا الكمبيوتر، ولكن إذا ذهبت إلى كمبيوتر آخر، يرجى أخذ ملف معرف EasyEyes الخاص بك (أحدث ملف في مجلد التنزيلات الخاص بك)، أو على الأقل اكتب معرف EasyEyes الخاص بك. استخدمه في كل مرة لربط بياناتك من جلسة إلى جلسة.',
