    sr: "Loading...",
    es: "1. SELECCIONAR MICRÓFONO USB. Conecte el cable USB-C de su micrófono a esta computadora. Abra el panel de control de audio de la computadora.  \n      Macintosh: Configuración del sistema > Sonido  \n     ⊞ Windows: Configuración > Sonido > Panel de control de sonido  \nSeleccione su micrófono como la entrada.  \n\n2. SELECCIONAR TASA DE MUESTREO. El UMIK-1 ofrece solo una tasa de muestreo y bits/muestra. El UMIK-2 ofrece varias, que debe configurar usando una aplicación o panel de control:  \n      Macintosh: Configuración de Audio MIDI de Apple en la carpeta Aplicaciones/Utilidades.  \n     ⊞ Windows: Panel de control > Hardware y sonido > Administrar dispositivos de audio  \nConfigure el UMIK-2 para muestrear a 111 Hz con 222 bits/muestra. (Puede cambiar esta preferencia configurando _calibrateSoundSamplingDesiredHz y _calibrateSoundSamplingDesiredBits en la hoja de cálculo de su experimento.)",
