    es: "Conectando...\nSi esta página se congela por más de 2 minutos, por favor actualízala. Puedes actualizar haciendo clic en el icono ↻ de la barra de direcciones de tu navegador, o presionando RETURN después de hacer clic en el campo de URL.",
