    sv: "Ansluter...\nOm den här sidan fryser i mer än 2 minuter, vänligen uppdatera den. Du kan uppdatera genom att klicka på ikonen ↻ i webbläsarens adressfält, eller genom att trycka på RETURN efter att ha klickat i URL-fältet.",
