    hi: '❌ क्षमा करें, MMM NNN, xxx, अभी तक प्रोफ़ाइल लाइब्रेरी में शामिल नहीं है। दूसरा माइक्रोफ़ोन आज़माने के लिए आगे बढ़ें दबाएँ। या "रिटर्न टू नीड्स पेज" पर क्लिक करें।',
    hu: '❌ Sajnáljuk, az MMM NNN, xxx, még nem szerepel a profilkönyvtárban. Nyomja meg a Folytatás gombot egy másik mikrofon kipróbálásához. Vagy kattintson a "Vissza a szükségletek oldalára" gombra.',
    is: '❌ Því miður, MMM NNN, xxx, er ekki enn með í prófílsafninu. Smelltu á Halda áfram til að prófa annan hljóðnema. Eða smelltu á "Fara aftur á þarfasíðu".',
    id: '❌ Maaf, MMM NNN, xxx, belum disertakan dalam perpustakaan profil. Tekan Lanjutkan untuk mencoba mikrofon lain. Atau tekan "Kembali ke Halaman Kebutuhan".',
    it: '\n❌ Spiacente, il MMM NNN, xxx, non è ancora incluso nella libreria dei profili. Premi Procedi per provare un altro microfono. Oppure premi "Ritorna alla pagina delle necessità".',
    ja: "❌ 申し訳ありませんが、MMM NNN、xxxはまだプロファイルライブラリに含まれていません。別のマイクを試すには「続行」を選択してください。または、「ニーズページに戻る」を選択してください。",
