    pl: '❌ Przepraszamy, MMM NNN, xxx, nie jest jeszcze zawarty w bibliotece profilu. Kliknij Przejdź, aby spróbować innego mikrofonu. Lub kliknij "Powrót do strony Wymagań"."',
    pt: '❌ Desculpe, o MMM NNN, xxx, ainda não está incluído na biblioteca de perfis. Clique em Continuar para tentar outro microfone. Ou clique em "Retornar à página de necessidades".',
    ro: "❌ Ne pare rău, MMM NNN, xxx, nu este încă inclus în biblioteca de profil. Apăsați Continuați pentru a încerca un alt microfon. Sau apăsați „Reveniți la pagina de nevoi”.",
    ru: "❌ К сожалению, МММ ННН, ХХХ пока не включен в библиотеку профилей. Нажмите «Продолжить», чтобы попробовать другой микрофон. Или нажмите «Вернуться на страницу потребностей».",
    sr: "❌ Жао нам је, МММ ННН, КСКСКС, још увек није укључен у библиотеку профила. Притисните Настави да испробате други микрофон. Или притисните „Повратак на страницу са потребама“.",
    es: '\n❌ Lo siento, el MMM NNN, xxx, aún no está incluido en la biblioteca de perfiles. Haz clic en Proceder para probar otro micrófono. O haz clic en "Volver a la página de necesidades".',
    sw: '❌ Samahani, MMM NNN, xxx, bado haijajumuishwa kwenye maktaba ya wasifu. Gonga Endelea ili kujaribu maikrofoni nyingine. Au gonga "Rudi kwenye Ukurasa wa Mahitaji".',
    sv: '❌ Tyvärr, MMM NNN, xxx, är ännu inte inkluderad i profilbiblioteket. Tryck på Fortsätt för att prova en annan mikrofon. Eller tryck på "Återgå till behovssidan".',
    tl: '"❌ Paumanhin, ang MMM NNN, xxx, ay hindi pa kasama sa profile library. Pindutin ang Magpatuloy upang subukan ang ibang mikropono. O pindutin ang "Bumalik sa Pahina ng Pangangailangan"."',
    tr: '❌ Üzgünüz, MMM NNN, xxx, henüz profil kütüphanesine dahil edilmedi. Başka bir mikrofon denemek için Devam\'a basın. Veya "İhtiyaçlar Sayfasına Dön"e basın.',
