    hy: "Պարզապես շրջվեք, և մենք կգտնենք ձեր դիտման հեռավորությունը: Խնդրում ենք, թույլ տվեք մուտք գործել ձեր տեսախցիկը:",
    bg: "Просто се обърнете и ние ще намерим вашето разстояние за гледане! Когато бъдете попитани, моля, дайте достъп до вашата камера.",
