    nl: "Draai u gewoon om en wij vinden uw kijkafstand! Verleen desgevraagd toegang tot uw camera.",
    "en-UK":
      "Simply turn around, and we will determine your viewing distance! When prompted, please allow access to your camera.",
    fi: "Käänny vain ympäri, niin löydämme katseluetäisyytesi! Anna kamerasi käyttöoikeus pyydettäessä.",
