    el: "Τα μάτια σας απέχουν 111 εκατοστά από την οθόνη, αλλά το πείραμα χρειάζεται 222 εκατοστά. Το πείραμα θα συνεχιστεί όταν φτάσετε στη σωστή απόσταση.",
    he: 'העיניים שלך מרוחקות 111 ס"מ מהמסך, אבל הניסוי צריך 222 ס"מ. הניסוי יתחדש כאשר תגיע למרחק הנכון.',
