    el: "Όπως αναφέρεται στην περιγραφή της, αυτή η μελέτη δεν είναι συμβατή με το ooo και χρειάζεται το πρόγραμμα περιήγησης BBB να λειτουργεί σε DDD με τουλάχιστον 222 πυρήνες CPU",
    he: "כפי שצוין בתיאור שלו, מחקר זה אינו תואם ל-ooo, וזקוק לדפדפן BBB הפועל על DDD עם לפחות 222 ליבות מעבד",
    hi: "जैसा कि इसके विवरण में कहा गया है, यह अध्ययन ओओओ के साथ असंगत है, और कम से कम 222 सीपीयू कोर के साथ डीडीडी पर चलने वाले बीबीबी ब्राउज़र की आवश्यकता है",
    hu: "Mint ahogy a leírásában is szerepel, ez a tanulmány nem kompatibilis az ooo-val, és a BBB böngésző futtatásához legalább 222 CPU maggal rendelkező DDD-re van szükség.",
    is: "Eins og fram kemur í lýsingunni er þessi rannsókn ósamrýmanleg ooo og þarf að BBB vafra keyrir á DDD með að minnsta kosti 222 CPU kjarna",
