    da: "Loading...",
    nl: "Loading...",
    "en-UK":
      "Participating in this study allows you to make a meaningful contribution to the advancement of online hearing research by providing essential data on the diverse range of smartphone microphones and computer speakers. This research aims to create a detailed library of device profiles that will enhance the accuracy of hearing tests conducted online. The scheme depends on matching the user's phone microphone to a lab-calibrated microphone. Each model has a different microphone, so it's crucial to specify the model. Understanding that privacy is a priority, please be assured that this survey retains only the model numbers of phones and computers. These model numbers are not linked to any personal information and do not identify you.",
    fi: "Loading...",
    fr: "Participer à cette étude vous permet de contribuer de manière significative à l'avancement de la recherche auditive en ligne en fournissant des données essentielles sur la gamme variée de microphones de smartphones et de haut-parleurs d'ordinateurs. Cette recherche vise à créer une bibliothèque détaillée de profils d'appareils qui améliorera la précision des tests auditifs réalisés en ligne. Le dispositif dépend de l'appariement du microphone du téléphone de l'utilisateur à un microphone calibré en laboratoire. Chaque modèle possède un microphone différent, il est donc crucial de spécifier le modèle.\n\nComprenez que la confidentialité est une priorité, soyez assuré que cette enquête ne conserve que les numéros de modèle des téléphones et des ordinateurs. Ces numéros de modèle ne sont liés à aucune information personnelle et ne peuvent pas être utilisés pour vous identifier individuellement.",
    de: "Diese Studie untersucht Smartphones und Computer. Die Umfrageergebnisse werden dazu beitragen, eine Profilbibliothek für Smartphone-Mikrofone und Computerlautsprecher zur Durchführung von Online-Hörstudien zu planen. Das Schema basiert auf der Zuordnung des Mikrofons des Benutzers zum kalibrierten Mikrofon im Labor. Jedes Modell hat ein anderes Mikrofon, daher ist es wichtig, das Modell anzugeben. Diese Umfrage enthält nur eine Liste von Telefon- und Computermodellen, ohne persönliche Identifikationsinformationen.",
    el: "Loading...",
    he: "Loading...",
    hi: "यह अध्ययन स्मार्टफोन और कंप्यूटरों की सर्वेक्षण करता है। सर्वेक्षण के परिणाम ऑनलाइन सुनने के शोध को संभव बनाने के लिए स्मार्टफोन माइक्रोफोन और कंप्यूटर लाउडस्पीकर की प्रोफ़ाइल पुस्तकालय की योजना बनाने में मदद करेंगे। इस योजना पर उपयोगकर्ता के फोन माइक्रोफोन को एक प्रयोगशाला-मान्यता प्राप्त माइक्रोफोन से मिलान करने पर निर्भर करती है। प्रत्येक मॉडल में एक अलग माइक्रोफोन होता है, इसलिए मॉडल की विशेषता निर्धारित करना महत्वपूर्ण है। इस सर्वेक्षण में केवल फोन और कंप्यूटर मॉडलों की सूची ही रखी गई है, किसी भी व्यक्तिगत पहचानित जानकारी के साथ नहीं।",
    hu: "Loading...",
    is: "Rannsóknin skoðar snjallsíma og tölvur. Niðurstöður rannsóknarinnar munu hjálpa til við að skipuleggja safn af prófílum fyrir hljóðnema snjallsíma og hátalara tölvu til að möguleggja netrannsóknir á heyrn. Kerfið byggist á því að tengja hljóðnemann snjallsíms notandans við kalibrerðan hljóðnema í rannsóknarstofu. Hver týpa hefur mismunandi hljóðnema, því er nauðsynlegt að tilgreina týpuna. Í þessari rannsókn er einungis geymd listi yfir snjallsíma og tölvumódel, án persónukenndra upplýsinga.",
    id: "Loading...",
    it: "Partecipare a questo studio ti permette di contribuire significativamente all'avanzamento della ricerca sull'udito online fornendo dati essenziali sulla varietà di microfoni per smartphone e altoparlanti per computer. Questa ricerca mira a creare una dettagliata biblioteca di profili di dispositivi che migliorerà l'accuratezza dei test dell'udito condotti online. Il programma dipende dall'abbinamento del microfono del telefono dell'utente con un microfono calibrato in laboratorio. Ogni modello ha un microfono diverso, quindi è cruciale specificare il modello.\n\nComprendendo che la privacy è una priorità, si prega di essere certi che questo sondaggio conserva solo i numeri di modello di telefoni e computer. Questi numeri di modello non sono collegati a nessuna informazione personale e non possono essere utilizzati per identificarti individualmente.",
    ja: "Loading...",
