    no: "Beklager, QR-koden ble ikke vist. Oppdater ↻ siden for et nytt forsøk. Hvis problemet vedvarer, trykk på KAN IKKE KOBLE TIL VIA QR-KODE-knappen nedenfor.",
    fa: "با عرض پوزش، کد QR ظاهر نشد. برای امتحان دیگری صفحه را بازخوانی کنید. اگر مشکل ادامه داشت، دکمه CAN'T CONNECT VIA QR CODE را در زیر فشار دهید.",
    pl: "Przepraszamy, kod QR nie pojawił się. Odśwież ↻ stronę, aby spróbować jeszcze raz. Jeśli problem będzie się powtarzał, naciśnij przycisk NIE MOŻNA POŁĄCZYĆ PRZEZ KOD QR poniżej.",
    pt: "Desculpe, o código QR não apareceu. Atualize ↻ a página para tentar novamente. Se o problema persistir, pressione o botão NÃO CONSEGUE CONECTAR VIA QR CODE abaixo.",
    ro: "Ne pare rău, codul QR nu a apărut. Actualizează ↻ pagina pentru o altă încercare. Dacă problema persistă, apăsați butonul NU POATE CONECTA PRIN COD QR de mai jos.",
    ru: "Извините, QR-код не появился. Обновите ↻ страницу, чтобы попытаться еще раз. Если проблема не устранена, нажмите кнопку «НЕ МОЖЕТ ПОДКЛЮЧИТЬСЯ ЧЕРЕЗ QR-КОД» ниже.",
    sr: "Жао нам је, КР код се није појавио. Освежите ↻ страницу за још један покушај. Ако проблем и даље постоји, притисните дугме НЕ МОГУ СЕ ПОВЕЗИВАТИ ПРЕКО КР КОДА.",
