    "en-UK":
      "CREATE A PLATFORM  \nWe need a raised platform (a level surface) to rest your phone on. This platform can be a glass, mug, jar, can, box, or a stack of books.\n\nPLACE THE PLATFORM  \n1. If you are using a laptop with speakers built into the keyboard, place your platform on the table between you and your computer, near the keyboard.\n\n2. If your computer has speakers located elsewhere, place your platform on the table between you and the speakers so that the far end of the phone on your platform is halfway between the speakers and your eyes when you’re using your computer.\n\nADJUST PLATFORM HEIGHT  \nYou can stack items, like books and a glass, to reach the right height. Make your platform tall enough so it's intermediate in height between the speakers and where your eyes are when you are sitting at the table using your computer.\n\nREADY?  \nWhen your platform is ready, press RETURN or click PROCEED to continue.",
    fi: "Loading...",
    fr: "CRÉER UNE PLATEFORME  \nNous avons besoin d'une plateforme surélevée (une surface plane) pour poser votre téléphone. Cette plateforme peut être un verre, une tasse, un bocal, une boîte ou une pile de livres.\n\nPLACER LA PLATEFORME  \n1. Si vous utilisez un ordinateur portable avec des haut-parleurs intégrés au clavier, placez votre plateforme sur la table entre vous et votre ordinateur, près du clavier.\n\n2. Si votre ordinateur a des haut-parleurs situés ailleurs, placez votre plateforme sur la table entre vous et les haut-parleurs de sorte que l'extrémité éloignée du téléphone sur votre plateforme soit à mi-chemin entre les haut-parleurs et vos yeux lorsque vous utilisez votre ordinateur.\n\nAJUSTER LA HAUTEUR DE LA PLATEFORME  \nVous pouvez empiler des objets, comme des livres et un verre, pour atteindre la bonne hauteur. Faites votre plateforme suffisamment haute pour qu'elle soit intermédiaire en hauteur entre les haut-parleurs et l'endroit où se trouvent vos yeux lorsque vous êtes assis à la table en utilisant votre ordinateur.\n\nPRÊT ?  \nLorsque votre plateforme est prête, appuyez sur RETOUR ou cliquez sur CONTINUER pour continuer.",
