    ar: "3. وجه الميكروفون لأعلى. قم بتثبيت الميكروفون على الحامل الثلاثي. يجب أن يكون الميكروفون عموديًا، موجهًا نحو السقف. ادفع الميكروفون لأعلى حتى يكون طرفه السفلي متساويًا مع الحامل. ضعه على الطاولة بينك وبين جهاز الكمبيوتر الخاص بك، مع وجود ساقين تقريبًا تلامسان جهاز الكمبيوتر.\n4. اختياري. قم بتعيين جهاز الكمبيوتر الخاص بك على وضع عدم الإزعاج.\n      ماكنتوش: 🟰 لوحة التحكم > التركيز > عدم الإزعاج\n     ⊞ ويندوز: ابدأ > الإعدادات > النظام > الإشعارات > عدم الإزعاج\n5. عندما تكون جاهزًا، انقر على زر المتابعة الذي سيظهر أدناه.",
