    bg: "Честотна характеристика, калибрирана със 111 повторения (след 222 загрявания) на 333-секунден импулс, семплирана при 444 Hz.",
    "zh-CN":
      "频率响应通过 333 秒突发的 111 次重复（222 次预热后）进行校准，以 444 Hz 采样。",
    "zh-HK":
      "頻率響應透過 333 秒突發的 111 次重複（222 次預熱後）進行校準，以 444 Hz 取樣。",
    hr: "Frekvencijski odziv kalibriran sa 111 ponavljanja (nakon 222 zagrijavanja) niza od 333 sekunde, uzorkovanih na 444 Hz.",
    cs: "Frekvenční odezva kalibrovaná se 111 opakováními (po 222 zahřátích) 333sekundového burstu, vzorkovaného při 444 Hz.",
    da: "Frekvensrespons kalibreret med 111 gentagelser (efter 222 opvarmninger) af en 333 sekunders burst, samplet ved 444 Hz.",
    nl: "Frequentierespons gekalibreerd met 111 herhalingen (na 222 opwarmingen) van een burst van 333 seconden, bemonsterd op 444 Hz.",
    "en-UK":
      "Frequency response calibrated with 111 repeats (after 222 warm-ups) of a 333 sec burst, sampled at 444 Hz.",
    fi: "Taajuusvaste kalibroitu 111 toistolla (222 lämmittelyn jälkeen) 333 sekunnin purskeesta, näyte 444 Hz:llä.",
    fr: "Réponse en fréquence calibrée avec 111 répétitions (après 222 échauffements) d'une salve de 333 secondes, échantillonnée à 444 Hz.",
    de: "Frequenzgang kalibriert mit 111 Wiederholungen (nach 222 Aufwärmübungen) eines 333-sekündigen Bursts, abgetastet bei 444 Hz.",
    el: "Η απόκριση συχνότητας βαθμονομήθηκε με 111 επαναλήψεις (μετά από 222 προθερμάνσεις) μιας έκρηξης 333 δευτερολέπτων, δειγματοληψία στα 444 Hz.",
    he: "תגובת התדר מכוונת עם 111 חזרות (אחרי 222 חימומים) של פיצוץ במשך 333 שניות, מוגבל בתדירות של 444 הרץ.",
    hi: "111 बार के साथ तरंग प्रतिक्रिया को 222 वार्मअप के बाद कैलिब्रेट किया गया, 333 सेकंड के बर्स्ट को 444 हर्ट्ज़ पर सैंपल किया गया।",
    hu: "Frekvenciaválasz 111 ismétléssel (222 bemelegítés után) kalibrálva egy 333 másodperces sorozatban, 444 Hz-en mintavételezett.",
    is: "Tíðnisvörun kvörðuð með 111 endurtekningum (eftir 222 upphitun) af 333 sekúndum straumi, tekin sýni við 444 Hz.",
