    he: 'בחר "סמארטפון" אם אתה משתמש במיקרופון הפנימי של הטלפון החכם או מחבר אליו מיקרופון חיצוני. אחרת בחר "USB".',
    hi: 'अगर आप अपने स्मार्टफोन के आंतरिक माइक्रोफोन का उपयोग करते हैं या उसे एक बाहरी माइक्रोफोन से कनेक्ट करते हैं तो "स्मार्टफोन" का चयन करें। अन्यथा "USB" का चयन करें।',
