    ko: '스마트폰 내장 마이크를 사용하거나 외부 마이크를 연결하는 경우에는 "스마트폰"을 선택하세요. 그렇지 않으면 "USB"를 선택하십시오.',
    lt: 'Pasirinkite "Smartphone", jei naudojate savo telefono vidinį mikrofoną arba prijungiate prie jo išorinį mikrofoną. Kitu atveju pasirinkite "USB".',
