    sr: 'Izaberite "Smartphone" ako koristite interni mikrofon svog pametnog telefona ili ga povežite sa spoljnim mikrofonom. U suprotnom, izaberite "USB".',
    es: 'Seleccione "Smartphone" si usa el micrófono interno de su smartphone o conecta un micrófono externo a él. De lo contrario, seleccione "USB".',
