    hr: "1. Stavite ovaj telefon na platformu koju ste izradili, kao što je čaša, šalica ili limenka. \n2. Rotirajte me da pročitam upute u nastavku.",
    cs: "1. Položte tento telefon na platformu, kterou jste vytvořili, jako je sklenice, hrnek nebo plechovka. \n2. Otočte mě a přečtěte si níže uvedené pokyny.",
    da: "1. Sæt denne telefon på den platform, du har oprettet, såsom et glas, krus eller dåse. \n2. Roter mig for at læse instruktionerne nedenfor.",
    nl: "1. Plaats deze telefoon op het platform dat je hebt gemaakt, zoals een glas, mok of blikje. \n2. Draai mij om de onderstaande instructies te lezen.",
    "en-UK":
      "1. Place this phone on the platform you've created, such as a glass, mug, or can. \n2. Rotate me to read the instructions below.",
    fi: "1. Aseta tämä puhelin luomallesi alustalle, kuten lasille, mukille tai purkille. \n2. Pyöritä minua lukeaksesi alla olevat ohjeet.",
