    de: "1. Stellen Sie dieses Telefon auf die von Ihnen erstellte Plattform, z. B. ein Glas, eine Tasse oder eine Dose. \n2. Drehen Sie mich, um die folgenden Anweisungen zu lesen.",
    el: "1. Τοποθετήστε αυτό το τηλέφωνο στην πλατφόρμα που δημιουργήσατε, όπως ένα ποτήρι, μια κούπα ή ένα κουτί. \n2. Περιστρέψτε με για να διαβάσετε τις παρακάτω οδηγίες.",
    he: "1. הנח את הטלפון הזה על הפלטפורמה שיצרת, כגון כוס, ספל או פחית. \n2. סובב אותי כדי לקרוא את ההוראות למטה.",
    hi: "1. इस फ़ोन को आपके द्वारा बनाए गए प्लेटफ़ॉर्म पर रखें, जैसे कि ग्लास, मग या कैन। \n2. नीचे दिए गए निर्देशों को पढ़ने के लिए मुझे घुमाएँ।",
    hu: "1. Helyezze ezt a telefont az Ön által létrehozott platformra, például pohárra, bögrére vagy dobozra. \n2. Forgassa el az alábbi utasítások elolvasásához.",
    is: "Augu þín eru xx1 cm frá skjánum, en tilraunin þarf um xx2 cm. Tilraunin mun halda áfram þegar þú nærð réttu fjarlægðinni.",
    id: "1. Letakkan ponsel ini pada platform yang telah Anda buat, misalnya gelas, mug, atau kaleng. \n2. Putar saya untuk membaca instruksi di bawah ini.",
    it: "1. Metti questo telefono sulla piattaforma che hai creato, come un bicchiere, una tazza o una lattina. \n2. Ruotami per leggere le istruzioni qui sotto.",
    ja: "1. グラス、マ​​グカップ、缶など、作成したプラットフォームにこの電話機を置きます。 \n2. 回転させて、以下の説明を読みます。",
    kn: "1. ಈ ಫೋನ್ ಅನ್ನು ನೀವು ರಚಿಸಿದ ಪ್ಲಾಟ್‌ಫಾರ್ಮ್‌ನಲ್ಲಿ ಇರಿಸಿ, ಉದಾಹರಣೆಗೆ ಗಾಜು, ಮಗ್ ಅಥವಾ ಕ್ಯಾನ್. \n2. ಕೆಳಗಿನ ಸೂಚನೆಗಳನ್ನು ಓದಲು ನನ್ನನ್ನು ತಿರುಗಿಸಿ.",
    ko: "1. 유리잔, 머그잔, 캔 등 자신이 만든 플랫폼 위에 이 전화기를 놓습니다. \n2. 나를 회전시켜 아래 지침을 읽어보세요.",
    lt: "1. Padėkite šį telefoną ant savo sukurtos platformos, pvz., stiklinės, puodelio ar skardinės. \n2. Pasukite mane, kad perskaitytumėte toliau pateiktas instrukcijas.",
    ms: "1. Letakkan telefon ini pada platform yang anda buat, seperti gelas, cawan atau tin. \n2. Putar saya untuk membaca arahan di bawah.",
    ml: "1. ഗ്ലാസ്, മഗ് അല്ലെങ്കിൽ ക്യാൻ പോലുള്ള നിങ്ങൾ സൃഷ്ടിച്ച പ്ലാറ്റ്‌ഫോമിൽ ഈ ഫോൺ ഇടുക. \n2. ചുവടെയുള്ള നിർദ്ദേശങ്ങൾ വായിക്കാൻ എന്നെ തിരിക്കുക.",
    no: "1. Sett denne telefonen på plattformen du har laget, for eksempel et glass, krus eller boks. \n2. Roter meg for å lese instruksjonene nedenfor.",
    fa: "1. این گوشی را روی پلتفرمی که ایجاد کرده اید، مانند لیوان، لیوان یا قوطی قرار دهید. \n2. من را بچرخانید تا دستورالعمل های زیر را بخوانید.",
    pl: "Twoje oczy są xx1 cm od ekranu, ale eksperyment wymaga około xx2 cm. Eksperyment zostanie wznowiony, gdy osiągniesz odpowiednią odległość.",
    pt: "1. Coloque este telefone na plataforma que você criou, como um copo, uma caneca ou uma lata. \n2. Gire-me para ler as instruções abaixo.",
