    nl: "Loading...",
    "en-UK":
      "On each trial, while you look at the cross, a triplet of three random LLLS will FLASH in the corner of your eye. Just a flash. To learn the task, let’s try it first with a STATIC display. While looking at the cross, below, without moving your eyes: What is the middle LLL?\n                    +.              2 7 3\nIt’s a 7. This display is static, so it would be easy to move your eyes to the LLL and identify it. But, in a real trial, the LLL is FLASHED, so there's no time to move your eyes. It's important to look at the cross as you initiate the trial. The LLL will flash immediately. It doesn't matter where your eyes go after the flash. The first block of testing is just a few trials of practice, before we start in earnest.",
    fi: "Loading...",
    fr: "À chaque essai, pendant que vous regardez la croix, un triplet de trois lettres aléatoires va CLIGNOTER dans le coin de votre œil. Juste un flash. Pour apprendre la tâche, essayons d'abord avec un affichage STATIQUE. En regardant la croix, ci-dessous, sans bouger vos yeux : Quelle est la lettre du milieu ?\n                    +.              H R C\nC'est un R. Cet affichage est statique, donc il serait facile de déplacer vos yeux vers la lettre et de l'identifier. Mais, lors d'un vrai essai, la lettre est CLIGNOTÉE, donc il n'y a pas le temps de bouger vos yeux. Il est important de regarder la croix lorsque vous initiez l'essai. La lettre va clignoter immédiatement. Peu importe où vos yeux vont après le flash. Le premier bloc de tests est juste quelques essais de pratique, avant de commencer sérieusement.",
