    hu: "Loading...",
    is: "Loading...",
    id: "Loading...",
    it: "In ogni prova, mentre guardi la croce, un tripletta di tre lettere casuali apparirà in un FLASH nell'angolo del tuo occhio. Solo un flash. Per imparare il compito, proviamolo prima con una visualizzazione STATIC. Mentre guardi la croce, qui sotto, senza muovere gli occhi: Qual è la lettera di mezzo?\n                    +.              H R C\nÈ una R. Questa visualizzazione è statica, quindi sarebbe facile spostare gli occhi verso la lettera e identificarla. Ma, in una prova reale, la lettera viene FLASHATA, quindi non c'è tempo per muovere gli occhi. È importante guardare la croce mentre inizi la prova. La lettera apparirà immediatamente. Non importa dove vanno i tuoi occhi dopo il flash. Il primo blocco di test è solo alcune prove di pratica, prima di iniziare sul serio.",
    ja: "各テストでは、あなたが十字線を見ている間に3つのランダムな文字があなたの目の端に短く表示されます。この場で試してみましょう。\n目を動かさずに十字線を見なが、真ん中の文字を識別してみてください。",
